var ctx,cx,cy, rec = [], frame = 0, bool = false, timer; //bool == playmode

window.onload = function (){
	ctx = document.getElementById( 'canvas' ).getContext( '2d' );
	setup();
	troll();
};

var isMouseDown = false;
document.onmousedown = function() { isMouseDown = true  };
document.onmouseup   = function() { isMouseDown = false };
document.onmousemove = function() { if ( !bool ) main() };

window.onresize = setup;

function setup(){
	ctx.canvas.width = window.innerWidth;
	ctx.canvas.height = window.innerHeight;
};

function changeColor( c ) { ctx.strokeStyle = c };
function changeSize( w ) { ctx.lineWidth = w };

function reco() {
	if ( bool ) {
		bool = false;
		document.getElementById( 'rec' ).value = 'Play';
		rec = [];
	} else {
		bool = true;
		timer = setInterval( 'main()', 1000/1000 );
	};
	frame = 0;
	ctx.clearRect( 0, 0, window.innerWidth, window.innerHeight );
};

function main() {
	px = cx;
	py = cy;
	cx = bool ? rec[ frame ].cx : event.pageX;
	cy = bool ? rec[ frame ].cy : event.pageY;

	if ( bool ) {
		ctx.strokeStyle = rec[frame].ss;
		ctx.lineWidth = rec[frame].si;
	} else { 
		rec[ frame++ ] = { isMouseDown: isMouseDown, cx: cx, cy: cy, ss:ctx.strokeStyle, si: ctx.lineWidth }
	};

	if ( bool ? rec[ frame ].isMouseDown : isMouseDown ) {
		draw( px, py, cx, cy )
	};

	if ( bool && !rec[ ++frame ] ) {
			clearInterval( timer );
			document.getElementById( 'rec' ).value = 'Draw';
	};
	
};

function draw( px, py, cx, cy ) {
	ctx.beginPath();
	ctx.moveTo( px, py );
	ctx.lineTo( cx, cy );
	ctx.stroke();
};

function save() {
	var confusing = window.open("", "Window", "width=500,height=200");
	confusing.document.write('<title>Export Code</title><code>' + JSON.stringify(rec) + '</code>');
}



